import React, {useState, useEffect} from 'react';


function Home({posts}) {
   
  return (
    <>
      <h1>Home</h1>
      {posts.map(repo => (
          <h1 key={repo.id}>{repo.name}</h1>
        ))}
    </>
    
  );
  
};

export default Home;
